import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate from react-router-dom
import '../styles/Home.css'// Import the CSS file for styling

// Import images
import chiliPowderImage from '../images/books1.png';
import amchurPowderImage from '../images/books2.jpg';
import nutmegPowderImage from '../images/books3.jpg';
import curryPowderImage from '../images/books4.jpg';
import teaMasalaImage from '../images/img5.png';
import whitePepperImage from '../images/img6.png';
import garlicPowderImage from '../images/img7.png';
import redPepperFlakesImage from '../images/img9.png';
import turmericPowderImage from '../images/img8.png';

const Navbar = ({ onSearch }) => {
  const navigate = useNavigate(); // Get navigate function

  // State to hold the search query
  const [searchQuery, setSearchQuery] = useState('');

  // Handle input change
  const handleInputChange = (e) => {
    const value = e.target.value;
    setSearchQuery(value);
    onSearch(value); // Pass search query to parent component
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <div className="navbar-content" onClick={() => navigate('/')}>
          <h1 className="navbar-title">My Store</h1>
          {/* You can also use an image/logo instead of text */}
          {/* <img src={logoImage} alt="Logo" className="navbar-logo" /> */}
        </div>
      </div>
      <div className="navbar-center">
        <input 
          type="text" 
          placeholder="Search products..." 
          value={searchQuery}
          onChange={handleInputChange}
          className="search-input"
        />
      </div>
      <div className="navbar-right">
        <button className="navbar-btn" onClick={() => navigate('/register')}>
          Register
        </button>
        <button className="navbar-btn" onClick={() => navigate('/login')}>
          Login
        </button>
      </div>
    </nav>
  );
};

const Home = () => {
  const navigate = useNavigate(); // Get navigate function
  const [searchQuery, setSearchQuery] = useState('');

  const products = [
    { id: 1, name: 'Chili powder', price: '$2', imgSrc: chiliPowderImage },
    { id: 2, name: 'Amchur powder', price: '$2', imgSrc: amchurPowderImage },
    { id: 3, name: 'Nutmeg powder', price: '$2', imgSrc: nutmegPowderImage },
    { id: 4, name: 'Curry powder', price: '$2', imgSrc: curryPowderImage },
    { id: 5, name: 'Tea masala', price: '$2', imgSrc: teaMasalaImage },
    { id: 6, name: 'White pepper', price: '$2', imgSrc: whitePepperImage },
    { id: 7, name: 'Garlic powder', price: '$2', imgSrc: garlicPowderImage },
    { id: 8, name: 'Red pepper flakes', price: '$2', imgSrc: redPepperFlakesImage },
    { id: 9, name: 'Turmeric powder', price: '$2', imgSrc: turmericPowderImage }
  ];

  // Filter products based on search query
  const filteredProducts = products.filter(product =>
    product.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  // Handle Add to Cart button click
  const handleAddToCart = () => {
    navigate('/login'); // Navigate to the register page
  };

  return (
    <div>
      <Navbar onSearch={setSearchQuery} />
      <section id="product">
        <div className="container">
          <div className="row">
            {filteredProducts.map(product => (
              <div key={product.id} className="column">
                <div className="card">
                  <img src={product.imgSrc} alt={product.name} className="card-img-top" />
                  <div className="card-body">
                    <h5 className="card-title">{product.name} - {product.price}</h5>
                    <button className="btn-primary" onClick={handleAddToCart}>
                      Add to Cart
                    </button>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
